import React from 'react';

import './style.css';

import logoImg from '../../assets/logo.svg';

export default function Profile() {
    return (
        <div className="profile-container">
            <header>
            <img src={ logoImg } alt= " Be the Hereo"/>
            <span></span>
            </header>
        </div>
    )
}
